window.bookSummaryJSON = "<p>With a vision of a world free from a war, a cat and his human minions set out to change humanity.</p> <p>An epic tale awaits. Follow Braden, Micah, and the Golden Warrior as their adventures take them through the wasteland to the mystical south of Planet Vii.</p> <p>Audiobook one: <i>Free Trader of Warren Deep</i>: The journey begins with G-War and Braden as they are trying to find their way, make one more trade, and set themselves up for life.</p> <p>Audiobook two: <i>Free Trader of Planet Vii</i>: It's no longer about just the Free Trader. He has a whole planet to change.</p> <p>Audiobook three: <i>Adventures on RV Traveler</i>: Braden, Micah, and G-War can't be constrained by one planet because what they need to accomplish can't be done on the ground. They head to the colonization ship for more adventures that will ultimately help the people of the planet to which they can't get home quickly enough.</p>"; 
